// HasPurchaseInvoices applies the HasEdge predicate on the "purchase_invoices" edge.
func HasPurchaseInvoices() predicate.Supplier {
	return predicate.Supplier(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(PurchaseInvoicesTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, true, PurchaseInvoicesTable, PurchaseInvoicesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasPurchaseInvoicesWith applies the HasEdge predicate on the "purchase_invoices" edge with a given conditions (other predicates).
func HasPurchaseInvoicesWith(preds ...predicate.PurchaseInvoice) predicate.Supplier {
	return predicate.Supplier(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(PurchaseInvoicesInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, true, PurchaseInvoicesTable, PurchaseInvoicesColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Supplier) predicate.Supplier {
	return predicate.Supplier(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Supplier) predicate.Supplier {
	return predicate.Supplier(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Supplier) predicate.Supplier {
	return predicate.Supplier(func(s *sql.Selector) {
		p(s.Not())
	})
}
